import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import logo from "./logo.png";

const Logo = props => {
  const { branding } = props;
  return (
    <div className="Logo">
      <p className="text-left display-4">
        <Link
          to="/"
          className="text-decoration-none text-secondary img-fluid max-width: 25% height "
        >
          <img src={logo} alt={branding} />
        </Link>
      </p>
    </div>
  );
};

Logo.defaultProps = {
  branding: "Bazinga"
};

Logo.propTypes = {
  branding: PropTypes.string.isRequired
};

export default Logo;
